RECORD 14 GENERAL TERMS AND CONDITIONS
ARTICLE IV. CREDITWORTHINESS 4.1 Creditworthiness of Shipper. Transporter shall not be required to perform or to continue Transportation or other services under this FERC Gas Tariff or any Service Agreement on behalf of any Shipper who is or who has become insolvent or who, at Transporter’s request, fails within a reasonable period to demonstrate creditworthiness. Upon submission of a Request for Service by the Shipper, and then from time to time at Transporter’s request, Shipper shall provide Transporter the following information in order for Transporter to analyze Shipper’s creditworthiness: Shipper’s latest audited financial statements, annual report, Form 10-K, a list of affiliates, three credit references and trade reference ratings and credit bureau reports.
4.2 Insolvency. For purposes of this FERC Gas Tariff, the insolvency of a Shipper shall be evidenced by:
(a) The filing by such Shipper, or parent entity thereof, of a voluntary petition in bankruptcy;
(b) The entry of a decree or order by a court having jurisdiction in the premises adjudging the Shipper as bankrupt or insolvent;
(c) The approving as properly filed a petition seeking reorganization, arrangement, adjustment or composition of, or in respect of, the Shipper under the Federal Bankruptcy Act or any other applicable federal or state law;
(d) The appointing of a receiver, liquidator, assignee, trustee, sequestrator, or other similar official of the Shipper or of any substantial part of the Shipper’s property; or
(e) The ordering of the liquidation of Shipper’s affairs, with said order or decree continuing unstayed and in effect for a period of sixty (60) consecutive Days.
4.3 Creditworthiness Standards. Transporter will support NAESB Version 2.0 business practices with respect to creditworthiness standards.
4.4 Credit Appraisal. Transporter’s credit appraisal procedures involve the establishment of dollar credit limits for each Shipper. To the extent that the value of the Services provided to a Shipper do not exceed the established credit limit, no new credit appraisal will be conducted if a Service Agreement is amended or Shipper requests new Services, provided that, at any time, Transporter may conduct a new credit appraisal if the Shipper’s payment history with Transporter has been not been satisfactory or Transporter is aware of or has been made aware of any bona fide basis for questioning a Shipper’s creditworthiness. If a Shipper fails to demonstrate creditworthiness, Shipper may obtain service under this FERC Gas Tariff and any Service Agreement by providing one of the following in an amount equal to the cost of performing the maximum service requested by Shipper for a three (3) Month period:
(a) Advance deposit;
(b) Standby irrevocable letter of credit drawn on a bank acceptable to Transporter;
Security interest in collateral found to be satisfactory to Transporter; or
(c) Guaranty, acceptable to Transporter, by any firm, corporation, agent, assignee, or legal representative who satisfies the creditworthiness criteria of Section 4.4 of these General Terms and Conditions.
